import java.util.TreeMap;

public class TreeMapDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
			TreeMap<Integer,String> treemap = new TreeMap<>();
			
			treemap.put(3, "three");
			treemap.put(2, "two");
			treemap.put(1, "one");
			
			System.out.println(treemap); 
			
	}

}
